import {
  AlbedoModule,
  allowAllModules,
  ISupportedWallet,
  StellarWalletsKit,
  WalletNetwork,
} from "@creit.tech/stellar-wallets-kit";
import { WalletConnection } from "@/app/types";

export const walletConnectDialog = async (
  wallet: ISupportedWallet,
  network: WalletNetwork
): Promise<WalletConnection> => {
  if (window.Cypress) {
    if (window.walletConnectDialogError) {
      throw Error();
    }
    return {
      stellarPubKey: "1234",
      walletType: wallet,
    } as WalletConnection;
  } else {
    try {
      let kit = new StellarWalletsKit({
        selectedWalletId: wallet.id,
        network,
        modules: allowAllModules(),
      });

      let addr = await kit.getAddress(); // will throw on error
      let pubKey = addr.address;

      return {
        stellarPubKey: pubKey,
        walletType: wallet,
        isAnonymous: false,
      };
    } catch (e: any) {
      throw e.message;
    }
  }
};

